import axios from "axios";
import { useState, useEffect } from "react";
import toast from "react-hot-toast";

function Details() {
  const [allDetails, setAllDetails] = useState({ managers: [], restaurants: [] });
  const [loading, setLoading] = useState(false);

  const getData = async () => {
    setLoading(true);
    try {
      const [managersResponse, restaurantsResponse] = await Promise.all([
        axios.get("http://localhost:4000/api/auth/getmanagers"),
        axios.get("http://localhost:4000/api/auth/getrestaurants"),
      ]);

      if (managersResponse.data.success && restaurantsResponse.data.success) {
        toast.success("Data fetched successfully!");
        setAllDetails({
          managers: managersResponse.data.managers || [],
          restaurants: restaurantsResponse.data.restaurants || [],
        });
      } else {
        toast.error("Failed to fetch data.");
      }
    } catch (error) {
      console.error("Error fetching data:", error);
      toast.error("Error fetching data. Please try again.");
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    getData();
  }, []);

  return (
    <div className="min-h-screen bg-gradient-to-b from-gray-100 via-blue-100 to-blue-200 p-5 flex flex-col items-center justify-center">
      <div className="max-w-5xl w-full bg-white p-8 rounded-xl shadow-lg mb-8">
        <h1 className="text-4xl font-bold text-blue-700 mb-4 text-center">Welcome Manager ðŸ‘‹</h1>
        <p className="text-gray-700 text-lg text-center">
          You can view your manager and restaurant details here.
        </p>
      </div>

      <div className="max-w-5xl w-full bg-white p-8 rounded-xl shadow-lg mb-10">
        <h2 className="text-2xl font-semibold text-gray-700 mb-5 text-center">Manager Details</h2>
        {allDetails.managers.length > 0 ? (
          <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6">
            {allDetails.managers.map((manager) => (
              <div key={manager._id} className="bg-blue-50 p-5 rounded-xl shadow border border-blue-200 hover:shadow-lg transition-all duration-300">
                <p><strong>Name:</strong> {manager.Name}</p>
                <p><strong>Aadhaar:</strong> {manager.AdharNumber}</p>
                <p><strong>Phone:</strong> {manager.PhoneNumber}</p>
                <p><strong>PAN:</strong> {manager.PanNumber}</p>
              </div>
            ))}
          </div>
        ) : (
          <p className="text-gray-600 text-center">No managers found.</p>
        )}
      </div>

      <div className="max-w-5xl w-full bg-white p-8 rounded-xl shadow-lg">
        <h2 className="text-2xl font-semibold text-gray-700 mb-5 text-center">Restaurant Details</h2>
        {allDetails.restaurants.length > 0 ? (
          <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6">
            {allDetails.restaurants.map((restaurant) => (
              <div key={restaurant._id} className="bg-blue-50 p-5 rounded-xl shadow border border-blue-200 hover:shadow-lg transition-all duration-300">
                <p><strong>Name:</strong> {restaurant.name}</p>
                <p><strong>Address:</strong> {restaurant.address}</p>
                <p><strong>Special For:</strong> {restaurant.specialfor}</p>
              </div>
            ))}
          </div>
        ) : (
          <p className="text-gray-600 text-center">No restaurants found.</p>
        )}
      </div>
    </div>
  );
}

export default Details;
